using System;
using UnityEngine;

public static class MaskOverlayResources
{
	public static Texture2D LoadBlobTexture_verySmooth()
	{
		Texture2D texture2D = new Texture2D(2, 2);
		string s = "";
		byte[] data = Convert.FromBase64String(s);
		texture2D.LoadImage(data);
		return texture2D;
	}

	public static Texture2D LoadBlobTexture()
	{
		Texture2D texture2D = new Texture2D(2, 2);
		string s = "";
		byte[] data = Convert.FromBase64String(s);
		texture2D.LoadImage(data);
		return texture2D;
	}

	public static Texture2D LoadDebugTexture()
	{
		Texture2D texture2D = new Texture2D(1, 1);
		texture2D.SetPixel(0, 0, Color.white);
		texture2D.Apply();
		return texture2D;
	}

	public static Material LoadBlobMaterial()
	{
		Shader shader = Resources.Load<Shader>("MaskOverlay_OverlayBlob");
		return new Material(shader);
	}

	public static Material LoadBlobMaterial_works_NovertexColor()
	{
		Shader shader = Resources.Load<Shader>("MaskOverlay_NoVertexColor");
		return new Material(shader);
	}

	public static Material LoadOverlayMaterial()
	{
		Shader shader = Resources.Load<Shader>("MaskOverlay");
		return new Material(shader);
	}
}
